import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Box,
  Button,
} from '@mui/material';
import {
  Telescope,
  LocalMall,
  Book,
  Home as HomeIcon,
  Toys,
  Lightbulb,
} from '@mui/icons-material';

const categories = [
  {
    name: 'Telescopes',
    description: 'Discover the cosmos with our premium telescopes',
    icon: <Telescope sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1579532537598-459ecdaf39cc?auto=format&fit=crop&w=1024&q=80',
    filter: 'Telescopes & Accessories',
    priceRange: '₹3,999 - ₹32,999',
  },
  {
    name: 'Merchandise',
    description: 'Show your love for space with NASA apparel',
    icon: <LocalMall sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1517976487492-5750f3195933?auto=format&fit=crop&w=1024&q=80',
    filter: 'Space Merchandise',
    priceRange: '₹999 - ₹1,999',
  },
  {
    name: 'Study Materials',
    description: 'Learn about the universe with our educational resources',
    icon: <Book sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1614935151651-0bea6508db6b?auto=format&fit=crop&w=1024&q=80',
    filter: 'Books & Education',
    priceRange: '₹799 - ₹1,499',
  },
  {
    name: 'Home Decor',
    description: 'Transform your space with cosmic-themed decorations',
    icon: <HomeIcon sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1534447677768-be436bb09401?auto=format&fit=crop&w=1024&q=80',
    filter: 'Home & Lifestyle',
    priceRange: '₹1,999 - ₹2,499',
  },
  {
    name: 'Space Toys',
    description: 'Educational and fun space toys for all ages',
    icon: <Toys sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1446776811953-b23d57bd21aa?auto=format&fit=crop&w=1024&q=80',
    filter: 'Gadgets & Kits',
    priceRange: '₹3,499 - ₹24,999',
  },
  {
    name: 'Galaxy Lamps',
    description: 'Bring the stars into your room with our galaxy projectors',
    icon: <Lightbulb sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1534293230397-c067fc201ab8?auto=format&fit=crop&w=1024&q=80',
    filter: 'Home & Lifestyle',
    priceRange: '₹1,999 - ₹2,499',
  },
];

const Home = () => {
  const navigate = useNavigate();

  return (
    <Box>
      {/* Hero Section */}
      <Box
        sx={{
          background: 'url(https://images.unsplash.com/photo-1462331940025-496dfbfc7564?auto=format&fit=crop&w=2048&q=80) center/cover no-repeat',
          height: { xs: '60vh', md: '80vh' },
          display: 'flex',
          alignItems: 'center',
          position: 'relative',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: 'linear-gradient(to bottom, rgba(0,0,0,0.7), rgba(0,0,0,0.3))',
          },
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 1 }}>
          <Typography
            variant="h2"
            sx={{
              color: 'white',
              fontWeight: 700,
              mb: 2,
              textShadow: '2px 2px 4px rgba(0,0,0,0.5)',
            }}
          >
            Explore the Cosmos
          </Typography>
          <Typography
            variant="h5"
            sx={{
              color: 'rgba(255,255,255,0.9)',
              mb: 4,
              textShadow: '1px 1px 2px rgba(0,0,0,0.5)',
            }}
          >
            Your gateway to the wonders of space
          </Typography>
          <Button
            variant="contained"
            size="large"
            onClick={() => navigate('/products')}
            sx={{
              bgcolor: '#7c4dff',
              '&:hover': {
                bgcolor: '#6c3fff',
                transform: 'translateY(-2px)',
              },
              transition: 'all 0.3s ease-in-out',
              textTransform: 'none',
              px: 4,
              py: 1.5,
            }}
          >
            Shop Now
          </Button>
        </Container>
      </Box>

      {/* Categories Section */}
      <Container maxWidth="lg" sx={{ py: 8 }}>
        <Typography
          variant="h3"
          sx={{
            mb: 6,
            textAlign: 'center',
            background: 'linear-gradient(45deg, #7c4dff, #1a237e)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
          }}
        >
          Featured Categories
        </Typography>
        <Grid container spacing={4}>
          {categories.map((category) => (
            <Grid item xs={12} sm={6} md={4} key={category.name}>
              <Card
                onClick={() => navigate('/products', { state: { category: category.filter } })}
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  cursor: 'pointer',
                  background: 'rgba(255,255,255,0.05)',
                  backdropFilter: 'blur(10px)',
                  border: '1px solid rgba(255,255,255,0.1)',
                  transition: 'all 0.3s ease-in-out',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                    boxShadow: '0 12px 20px rgba(0,0,0,0.2)',
                    border: '1px solid rgba(124, 77, 255, 0.3)',
                    '& .MuiCardMedia-root': {
                      transform: 'scale(1.1)',
                    },
                  },
                }}
              >
                <Box sx={{ position: 'relative', overflow: 'hidden', pt: '60%' }}>
                  <CardMedia
                    component="img"
                    image={category.image}
                    alt={category.name}
                    sx={{
                      position: 'absolute',
                      top: 0,
                      left: 0,
                      width: '100%',
                      height: '100%',
                      transition: 'transform 0.3s ease-in-out',
                    }}
                  />
                  <Box
                    sx={{
                      position: 'absolute',
                      top: 0,
                      left: 0,
                      width: '100%',
                      height: '100%',
                      background: 'linear-gradient(to bottom, rgba(0,0,0,0.4), rgba(0,0,0,0.1))',
                    }}
                  />
                  <Box
                    sx={{
                      position: 'absolute',
                      top: 16,
                      left: 16,
                      color: 'white',
                      bgcolor: 'rgba(124, 77, 255, 0.9)',
                      borderRadius: '50%',
                      p: 1,
                    }}
                  >
                    {category.icon}
                  </Box>
                </Box>
                <CardContent sx={{ flexGrow: 1, bgcolor: 'transparent' }}>
                  <Typography variant="h5" component="h2" sx={{ color: 'white', mb: 1 }}>
                    {category.name}
                  </Typography>
                  <Typography sx={{ color: 'rgba(255,255,255,0.7)', mb: 2 }}>
                    {category.description}
                  </Typography>
                  <Typography sx={{ color: '#7c4dff', fontWeight: 500 }}>
                    {category.priceRange}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Home;
